description:
AND EITHER

The National High School Exam (Enem) is a test taken by students in the last year of high school. This test is one of the ways to enter undergraduate courses.

With the ENEM application, you will be able to:

- View the race schedule;
- Monitor your registration;
- Monitor application for exemption from registration fee;
- Have access to notices and news;
- Check frequently asked questions and guidelines;
- View your grade and writing of previous Enem tests.

Important: You can only enroll in Enem through the site enem.inep.gov.br/participante. It is not possible to register through the application.
